// src/Home.js
import React from 'react';

const Home = () => {
    return (
        <div style={{ padding: '20px', textAlign: 'center' }}>
            <h1>Welcome to the Home Page</h1>
            <p>This is a simple React application.</p>
        </div>
    );
};

export default Home;
